func NewBequant(userConfig map[string]interface{}) *Bequant {
   p := NewBequantCore()
   p.Init(userConfig)
   return &Bequant{
       BequantCore: p,
       Core:  p,
       exchangeTyped: NewHitbtcFromCore(&(p.HitbtcCore)),
   }
}
func NewBequantFromCore(core *HitbtcCore) *Hitbtc {
   return &Hitbtc{
       HitbtcCore: core,
       Core:  core,
       exchangeTyped: NewExchangeTyped(&core.Exchange),
   }
}

